h4.Le(null,new $APP.N(null,2,5,$APP.O,[$APP.lt,rO],null),function(){return"\n####規約について\n以下は、当サイトご利用上の規約となります。AI先生の利用者は、以下の規約に同意したものとします。ご同意いただけない場合は、AI先生のご利用を中止して下さい。\n\n当サイトの規約は、予告なく変更となることがあります。ただし、利用規約が変更となった場合は、AI先生の次回利用時にサイト管理者は利用者に知らせるものとします。しかしながら、必ずユーザー自身の責任において、告知後に該当変更箇所を確認をお願いいたします。告知後、AI先生を利用する場合は、変更後の利用規約に同意したものとします。\n\nこれらの規約は、AI先生の運営者と、利用者との間の規約であり、第三者的な権利、主張を新たに発生させるものではありません。\n\nこの利用規約には、ドイツの法が適用されます。しかし、これらは、各利用地域に定められた個人の有する権利を侵害するものではありません。\n\nもし以下の規約のうち、各ユーザーの利用地域において違法性、その他本規約と矛盾を生じる法律があった場合、以下に示す規約は、当該地域においてのみ法律上有効な範囲内で原文に最も近い内容に置き換えられます。\n\n####無料コンテンツについて\nAI先生は、多くの棋譜やニュース記事などを掲載しています。これらは、本サイトへの登録やログインなしに閲覧することができます。しかし、これらのコンテンツは予告なく変更、削除される可能性があります。\n\n####登録について\n本サイトに登録したアカウントのご使用は、登録者ご本人様に限定します。複数人で同一のアカウントを共有することはできません。また、ご登録の際に使用したパスワードを第三者と共有することは、セキュリティの観点からお控え頂ますよう、どうぞよろしくお願いいたします。ただし、以下に示す場合のみ、登録者と利用者が異なることを認めます。\nー利用者が18歳未満の場合、保護者が登録者となり、18歳未満の方が当該保護者の管理のもとで使用すること。\n\n####クレジットの購入\n当サイトのクレジットを購入を以て、サイト運営者と利用者の間の契約とします。クレジットは、KataGoや類似の囲碁AIを用いて棋譜を分析するためのみに用いることができます。\n\n####返金及び免責事項\nクレジットの購入時から起算して14日以内であれば、購入されたクレジットが全く使用されていない場合に限り、返金処理を受け付けます。返金処理を依頼される方は、ai.sensei.info@gmail.comまでご連絡ください。その際、以下のテンプレートをご利用ください。（クレジット購入日を含めて14日後の23時59分までに返金処理の依頼メールを送付して下さい。例えば、6月13日中にクレジット購入をされた場合は、14日後の6月27日の23時59分までに下記のテンプレートに沿って返金処理の依頼メールを送付して下さい）\n\x3chr/\x3e\n```\n返金依頼\n\n【登録名】\n【購入日時】\n【購入したクレジット数】\n```\n\x3chr/\x3e\n**上記で定められたこと以外で、私達がサービスのコンテンツ、質、ユーザーインターフェースなどの改善の要望に対して、日本で定められた法律に反しない限り、サイト運営者が応える義務は一切負わないものとします。**\n\n####棋譜のアップロードについて\n事前にクレジットをご購入いただくことで、SGFファイルをサイトにアップロードすると、AIの一手による自動解析を受けることができるようになります。\n本サイトでは、使用クレジットに応じて、下記の二つの分析レベルを設けています。\n・銀（１クレジット）：Leelaネットワーク#157を用いて、一手につき最低1,000手を考察します。\n・金（５クレジット）：Leelaネットワーク#157を用いて、一手につき最低10,000手を考察します。\n今後、より高性能なネットワークを用いたり、全く違うAIの一手を用いることで、考察する手数が変動する可能性がありますが、現在の分析よりもレベルが下がることはありません。\n\n####分析スピードについて\n通常、分析には5分程度の時間を要します。しかし、アクセスが集中した場合や、サーバー側に問題が生じた場合は、より多くの時間を分析に要する可能性があります。そのため、分析に要する時間の保証は致しかねます。\n分析が長時間終わらない場合は、サポートまでご連絡ください。\n\n####分析の正確性について\n私たちが分析に用いているAIの一手は通常、人間よりも強い囲碁を打ちますが、悪手を打つ可能性も存在します。各分析の正確性について、確実に良い手であるとの保証は出来かねます。\n\n####棋譜のダウンロードについて\nSGFファイル形式で提供されるAI先生の分析棋譜の利用は、個人に限定させていただきます。また、あらゆる商用利用は禁止いたします。個人の範囲を超える使用をしたい場合は、サイト運営者に必ず事前に許可を得てください。\n\n####不正行為について\nAI先生を、囲碁大会やオンライン囲碁対戦などで不正に使用することを禁止いたします。不正が疑われるとの通報が入った場合は、運営者側で調査をし、結果を大会運営者やオンライン囲碁対戦の運営者に報告をする可能性があります。その場合、当サイトに登録されている当該アカウントは凍結され、残クレジットの権利は消失し、払い戻し等も一切いたしません。\n\n####当サイトの運営期間について\n当サイトは、運営を停止する場合は、法的義務、脅迫、倒産などにより即時閉鎖の義務が生じた場合などを除き、残クレジットの利用や棋譜のダウンロードができるよう、最低でも6か月前には利用者にその旨を通達いたします。\n\n####免責事項\n当サイトのご利用により生じた上記に定めた内容を除く一切の損害について、法律に反しない限りで、当サイト運営者は責任を一切放棄します。賠償責任などが生じた際も、当該サイト利用者から支払われた額を超える保証は一切致しません。また、事前に予期することのできなかったと考えられる損失、損害などについても、一切の責任を負いません。\n\n####商用利用\nこのウェブサイトを商用利用する場合、商用利用したことにより関係が生じたあらゆる人はこの規約に同意したものとします。私達自身、私達の広告主、雇用関係にある人、事務員、調査員は、商用利用により生じたあらゆる問題に関して一切責任を負いません。本ウェブサイトを商用利用したことにより生じた損害、損失、訴訟、主張、訴訟費用、弁護士費用その他あらゆる賠償及び支払いを致しません。\n"});
